import React, { useState } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';
import './App.css';

const Re = () => {
  const [lendBooks, setLendBooks] = useState([
    {
      member: 'John Doe',
      bookTitle: 'Book 1',
      author: 'Author 1',
      issueDate: '2023-07-01',
      returnDate: '2023-07-10',
      price: '$10',
    },
    // Add more books here
  ]);

  const [returnedBooks, setReturnedBooks] = useState([
    {
      member: 'Jane Smith',
      bookTitle: 'Book 2',
      author: 'Author 2',
      issueDate: '2023-06-01',
      elapse: '30 days',
      returnDate: '2023-07-01',
      fine: '$5',
    },
    // Add more books here
  ]);

  const handleReturn = (index) => {
    // Implement return logic here
    console.log('Returned book:', lendBooks[index]);
  };

  const handleEdit = (index) => {
    // Implement edit logic here
    console.log('Edit book:', lendBooks[index]);
  };

  const handleDelete = (index) => {
    // Implement delete logic here
    console.log('Delete book:', lendBooks[index]);
  };

  return (
    <div className="App">
      <Tabs>
        <TabList>
          <Tab>Lend Book</Tab>
          <Tab>Returned Book</Tab>
        </TabList>

        <TabPanel>
          <h2>Lend Book</h2>
          <table>
            <thead>
              <tr>
                <th>Member</th>
                <th>Book Title</th>
                <th>Author</th>
                <th>Issue Date</th>
                <th>Return Date</th>
                <th>Price</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {lendBooks.map((book, index) => (
                <tr key={index}>
                  <td>{book.member}</td>
                  <td>{book.bookTitle}</td>
                  <td>{book.author}</td>
                  <td>{book.issueDate}</td>
                  <td>{book.returnDate}</td>
                  <td>{book.price}</td>
                  <td>
                    <button onClick={() => handleReturn(index)}>Return</button>
                    <button onClick={() => handleEdit(index)}>Edit</button>
                    <button onClick={() => handleDelete(index)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </TabPanel>

        <TabPanel>
          <h2>Returned Book</h2>
          <table>
            <thead>
              <tr>
                <th>Member</th>
                <th>Book Title</th>
                <th>Author</th>
                <th>Issue Date</th>
                <th>Elapsed</th>
                <th>Return Date</th>
                <th>Fine</th>
              </tr>
            </thead>
            <tbody>
              {returnedBooks.map((book, index) => (
                <tr key={index}>
                  <td>{book.member}</td>
                  <td>{book.bookTitle}</td>
                  <td>{book.author}</td>
                  <td>{book.issueDate}</td>
                  <td>{book.elapse}</td>
                  <td>{book.returnDate}</td>
                  <td>{book.fine}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </TabPanel>
      </Tabs>
    </div>
  );
};

export default App;
